labels.HAPROXY_1_BACKEND_HEAD:
backend {backend}
  balance {balance}
  mode {mode}
  timeout server 30m
  timeout client 30m

apps.cmd:
echo ROLE ID: ${VAULT_ROLE_ID}; 
echo SECRET ID: ${VAULT_SECRET_ID}; 
sleep 50

labels.HAPROXY_1_BACKEND_HTTP_OPTIONS:
option forwardfor
 http-request set-header X-Forwarded-Port %[dst_port]
 http-request add-header X-Forwarded-Proto https if { ssl_fc }
